    false,nt"url": null,nt"notes": "The Sea Level Rise and Coastal Flooding
    Impacts Viewer depicts potential sea level rise and its associated impacts on the
    nation's coastal areas. These coastal areas include all the states (except for Alaska,
    Louisiana, and Great Lake states) and the U.S. territories of Guam, Puerto Rico,
    Saipan, and the U.S. Virgin Islands. The purpose of the mapping viewer is to provide
    coastal managers and scientists with a preliminary look at sea level rise (slr)
    and coastal flooding impacts. Being able to visualize potential impacts from sea
    level rise is a powerful teaching and planning tool, and the viewer brings this
    capability to coastal communities. The viewer is a screening-level tool that uses
    nationally consistent data sets and analyses. Data and maps provided can be used
    at several scales to help gauge trends and prioritize actions for different scenarios.
    The Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr/.
    Some of the features of this tool are: 1. Displays potential future sea levels 2.
    Provides simulations of sea level rise at local landmarks 3. Communicates the spatial
    uncertainty of mapped sea levels 4. Models potential marsh migration due to sea
    level rise 5. Overlays social and economic data onto potential sea level rise 6.
    Examines how tidal flooding will become more frequent with sea level rise",nt"license_title":
